import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LandingPage from './src/components/landingpage'

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/landing" element={<LandingPage />} />

      </Routes>
    </Router>
  );
}

export default App;
